function ProfileCard(props){
    const title = props.title;
    const handle = props.handle;
    return (
        <div>
            <div>the title is {props.title}.</div>
            <div>the handle is {props.handle}.</div>
            <br></br>
        </div>
    );
}
export default ProfileCard;
